import styled from "styled-components";
import "./App.css";
import Navbar from "./components/Navbar";

function App() {
  return (
    <MainContainer>
      <Navbar />
    </MainContainer>
  );
}

export default App;

const MainContainer = styled.div`
  width: 100%;
  position: absolute;
  top: 0%;
  left: 0%;

  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  background-color: #472d2d;
`;
